import React from 'react'

import {FaFile, FaImage,FaVideo, FaLink,FaPlus } from 'react-icons/fa';

import './NewResources.css'

const ResourceSide = () => {
  return (
    <div className='resource-page'>
      <div className='resource-page-header'>
        <a ><FaFile size={'1.5rem'} color='#ffffff'/></a>
        <a ><FaImage size={'1.5rem'} color='#ffffff'/></a>
        <a ><FaVideo size={'1.5rem'} color='#ffffff'/></a>
        <a ><FaLink size={'1.5rem'} color='#ffffff'/></a>
        <a ><FaPlus size={'1.5rem'} color='#ffffff'/></a>
      </div>
      <div>
      </div>
    </div>
  )
}

export default ResourceSide;
